import React from 'react'

const MenuItem = ({menu}) => {
    return (
        <tr>
            <td>
                {menu.first}
            </td>
            <td>
                {menu.second}
            </td>
            <td>
                {menu.third}
            </td>
        </tr>
    )
}

const MenuList = ({menus}) => {
    return (
        <table>
            <th>
                1
            </th>
            <th>
                2
            </th>
            <th>
                3
            </th>
            {menus.map((menu) => <MenuItem menu={menu} />)}
        </table>
    )
}

export default MenuList
